    function getAcceleration() {
      var data = fakeAcceleromaterData();
      return _.map(data.slice(0, 50), function(item) {
        return {
          time: item.time,
          gamma: item['gamma'],
          alpha: item['alpha'],
          beta: item['beta']
        };
      });
    }

    function getRotation() {
      var data = fakeAcceleromaterData();
      return _.map(data.slice(0, 50), function(item) {
        return {
          time: item.time,
          x: item['x'],
          y: item['y'],
          z: item['z']
        };
      });
    }
